However, if you don't want to use an external library, you can use a simple markdown parser implemented in C++. Here's a basic example:

```cpp
#include <string>
#include <vector>
#include <algorithm>

/**
 * Converts markdown formatted text to HTML.
 *
 * @param markdown The markdown formatted text to convert.
 * @return The HTML formatted text.
 */
std::string markdownToHtml(const std::string& markdown) {
    std::string html;
    size_t pos = 0;

    while (pos < markdown.size()) {
        // Check for headers
        if (markdown.substr(pos, 2) == "# ") {
            size_t endPos = markdown.find('\n', pos);
            if (endPos == std::string::npos) {
                endPos = markdown.size();
            }
            html += "<h" + std::to_string(markdown[pos + 2] - '0') + ">" + markdown.substr(pos + 2, endPos - pos - 2) + "</h" + std::to_string(markdown[pos + 2] - '0') + ">\n";
            pos = endPos + 1;
            continue;
        }

        // Check for bold text
        if (markdown.substr(pos, 2) == "**") {
            size_t endPos = markdown.find('**', pos);
            if (endPos == std::string::npos) {
                endPos = markdown.size();
            }
            html += "<b>" + markdown.substr(pos + 2, endPos - pos - 2) + "</b>\n";
            pos = endPos + 2;
            continue;
        }

        // Check for italic text
        if (markdown.substr(pos, 2) == "*") {
            size_t endPos = markdown.find('*', pos);
            if (endPos == std::string::npos) {
                endPos = markdown.size();
            }
            html += "<i>" + markdown.substr(pos + 1, endPos - pos - 1) + "</i>\n";
            pos = endPos + 1;
            continue;
        }

        // Check for links
        if (markdown.substr(pos, 2) == "[") {
            size_t endPos = markdown.find(']', pos);
            if (endPos == std::string::npos) {
                endPos = markdown.size();
            }
            size_t linkEndPos = markdown.find('(', endPos);
            if (linkEndPos == std::string::npos) {
                linkEndPos = markdown.size();
            }
            html += "<a href=\"" + markdown.substr(endPos + 1, linkEndPos - endPos - 1) + "\">" + markdown.substr(pos + 1, endPos - pos - 1) + "</a>\n";
            pos = linkEndPos + 1;
            continue;
        }

        // Check for images
        if (markdown.substr(pos, 2) == "!") {
            size_t endPos = markdown.find(' ', pos);
            if (endPos == std::string::npos) {
                endPos = markdown.size();
            }
            size_t linkEndPos = markdown.find('(', endPos);
            if (linkEndPos == std::string::npos) {
                linkEndPos = markdown.size();
            }
            html += "<img src=\"" + markdown.substr(endPos + 1, linkEndPos - endPos - 1) + "\">";
            pos = linkEndPos + 1;
            continue;
        }

        // If none of the above conditions are met, just append the text
        html += markdown.substr(pos, 1);
        pos++;
    }

    return html;
}
```

This function supports basic markdown syntax, including headers, bold text, italic text, links, and images. However, it does not support more complex syntax, such as tables, lists, or code blocks.

