**Queue Implementation using Two Stacks in Python**
=====================================================

Here's a Python implementation of a queue data structure using two stacks. This implementation provides the basic queue operations: `enqueue`, `dequeue`, `peek`, and `is_empty`.

```python
class Stack:
    """A basic stack implementation."""
    def __init__(self):
        self.items = []

    def push(self, item):
        """Add an item to the top of the stack."""
        self.items.append(item)

    def pop(self):
        """Remove and return the top item from the stack."""
        if not self.is_empty():
            return self.items.pop()
        return None

    def peek(self):
        """Return the top item from the stack without removing it."""
        if not self.is_empty():
            return self.items[-1]
        return None

    def is_empty(self):
        """Check if the stack is empty."""
        return len(self.items) == 0


class Queue:
    """A queue implementation using two stacks."""
    def __init__(self):
        self.stack_newest_on_top = Stack()
        self.stack_oldest_on_top = Stack()

    def enqueue(self, item):
        """Add an item to the end of the queue."""
        self.stack_newest_on_top.push(item)

    def dequeue(self):
        """Remove and return the oldest item from the queue."""
        if self.is_empty():
            return None

        # If the oldest stack is empty, move all items from the newest stack to the oldest stack
        if self.stack_oldest_on_top.is_empty():
            while not self.stack_newest_on_top.is_empty():
                self.stack_oldest_on_top.push(self.stack_newest_on_top.pop())

        # Remove and return the oldest item from the oldest stack
        return self.stack_oldest_on_top.pop()

    def peek(self):
        """Return the oldest item from the queue without removing it."""
        if self.is_empty():
            return None

        # If the oldest stack is empty, move all items from the newest stack to the oldest stack
        if self.stack_oldest_on_top.is_empty():
            while not self.stack_newest_on_top.is_empty():
                self.stack_oldest_on_top.push(self.stack_newest_on_top.pop())

        # Return the oldest item from the oldest stack
        return self.stack_oldest_on_top.peek()

    def is_empty(self):
        """Check if the queue is empty."""
        return self.stack_newest_on_top.is_empty() and self.stack_oldest_on_top.is_empty()


# Example usage:
queue = Queue()
queue.enqueue(1)
queue.enqueue(2)
queue.enqueue(3)

print(queue.dequeue())  # Output: 1
print(queue.peek())     # Output: 2
print(queue.dequeue())  # Output: 2
print(queue.dequeue())  # Output: 3
print(queue.is_empty())  # Output: True
```

This implementation uses two stacks: `stack_newest_on_top` and `stack_oldest_on_top`. The `enqueue` operation adds items to the top of `stack_newest_on_top`. The `dequeue` operation removes items from the top of `stack_oldest_on_top`. If `stack_oldest_on_top` is empty, it moves all items from `stack_newest_on_top` to `stack_oldest_on_top` before removing the oldest item. The `peek` operation returns the top item from `stack_oldest_on_top` without removing it. The `is_empty` operation checks if both stacks are empty.
